import { useAuth } from "./context/AuthProvider";
export const Home = () => { 
    const { value } = useAuth();
    return (
      <>
        <h2>Home (Public)</h2>
        <label for="username"> Username:</label>
        <input type="text" id="username" name="name" required minlength="4" maxlength="8" size="10" />

        <button type="button" onClick={value.onLogin}>
          Sign In
        </button>
    </>
  );
};
